Method.Implementation:
// Check parameters
if pFromCode = "" quit 0
if pFromCS = "" quit 0
if pToCS = "" quit 0
set %Break=""
set tSC=1

;Check to see if translation can be done by HS
if $D(^HS.Registry.TranslationMapD($ZCVT(pFromCS,"U"),pToCS,$ZCVT(pFromCode,"U")),map) {
	// Map exists in HS, handle internally
	If pFromDesc'=""&&$D(^HS.Registry.TranslationMapD($ZCVT(pFromCS,"U"),pToCS,$ZCVT(pFromCode,"U"),"DescriptionExceptions",$ZCVT(pFromDesc,"U")),tExcept) {
		Set pToCode=$P(tExcept,"||"),pToDesc=$P(tExcept,"||",2)
	} Else {
		Set pToCode=$LI(map,5),pToDesc=$LI(map,6) Quit:pToCode="" tSC
	}
}
else {
	// Map doesnt exist in HealthShare, per Rick Ross
	//// **** CTT/VETS **** ////
	; cache VUIDS for re-use by this process
	; When CTT/VETS has to be called, add translations to local HealthShare maps for future use
	; Codes added to HS should be purged after 15 days using HS.Local.VA.Terminology.WebServices:DeleteOldTranslationMaps
	;
	// Get the service
	set tWS = ##class(HS.Local.VA.Terminology.VETS.Client.stsPort).%New()
	;
	try {
		;break:%Break["s"
		// Get from code system VUID
		;if '$d(%HSTranslateVUID("cs",pFromCS))
		;{
		;	set tCS = tWS.ListCodeSystems(pFromCS)
		;	if tCS.TotalNumberOfRecords '= 1 set tSC=0 quit
		;	set tFromCSVUID = tCS.CodeSystems.GetAt(1).VUID
		;	set %HSTranslateVUID("cs",pFromCS)=tFromCSVUID
		;}
		;else {
		;	set tFromCSVUID = %HSTranslateVUID("cs",pFromCS)
		;}             
		;
		;break:%Break["t"
		// Get to code system VUID
		;if '$d(%HSTranslateVUID("cs",pToCS))
		;{
		;	set tCS = tWS.ListCodeSystems(pToCS)
		;	if tCS.TotalNumberOfRecords '= 1 set tSC=0 quit
		;	set tToCSVUID = tCS.CodeSystems.GetAt(1).VUID
		;	set %HSTranslateVUID("cs",pToCS) = tToCSVUID
		;}
		;else {
		;	set tToCSVUID = %HSTranslateVUID("cs",pToCS)
		;}
		;
		;break:%Break["m"
		// Locate map set VUID for from/to code systems
		;if '$d(%HSTranslateVUID("ms",tFromCSVUID,tToCSVUID))
		;{
		;	set tMS = tWS.ListMapSets(,tFromCSVUID,,tToCSVUID)
		;	set tMSCt = 0 kill tMSArry
		;	while tMSCt < tMS.TotalNumberOfRecords {
		;		set tMSCt = $i(tMSCt)
		;		set tMSD = tMS.MapSetDetails.GetAt(tMSCt)
		;		set tMSDEff = tMSD.EffectiveDate set:tMSDEff="" tMSDEff = "*"
		;		set tMSDVUID = tMSD.VUID
		;		if tMSDEff]"",tMSDVUID]"" set tMSArry(tMSDEff,tMSDVUID)="",tMSArry=$i(tMSArry)
		;	}
		;	if $g(tMSArry)<1 set tSC=0 quit
		;	set tMSEff = $zp(tMSArry("")) if tMSEff="" set tSC=0 quit
		;	set tMSVUID = $zp(tMSArry(tMSEff,"")) if tMSVUID="" set tSC=0 quit
		;	set %HSTranslateVUID("ms",tFromCSVUID,tToCSVUID) = tMSVUID
		;}
		;else {
		;	set tMSVUID = %HSTranslateVUID("ms",tFromCSVUID,tToCSVUID)
		;}
		break:%Break["l" 
		; pToCS is now the map-set VUID to use for translation
		set tMSVUID = pToCS
		// Lookup actual tocode using found translation map            
		set tSources = ##class(%ListOfDataTypes).%New()
		do tSources.Insert(pFromCode)
		set tME = tWS.ListMapEntriesFromSource(tMSVUID,"current",tSources)
		; We only handle 1-1 mappings
		if tME.TotalNumberOfRecords '= 1 set tSC=0 quit
		set tMEV1 = tME.MapEntryValues.GetAt(1)
		; grab the target code/description
		set pToCode = tMEV1.TargetValue
		set pToDesc = tMEV1.TargetDesignationName
		; if target description is null use the source description
		set:pToDesc="" pToDesc = pFromDesc
		; If CTT/VETS returns a target code, add to HS translation tables
		if pToCode {
			set tSC=..SaveTranslationMap("",pFromCS,pToCS,pFromCode,pToCode,pToDesc)
		}
	}
	catch (e)
	{
		set tSC=e
	}
}
quit tSC

Set tSC=##class(HS.Util.HubServices).InvokeHubService("HS.Hub.HSWS.WebServices","HS.Hub.HSWS.WebServicesClient","AddEditTranslationMap",.tObj,pMap)
if tObj.Status=1 {
	Set tCTTObj=##class(HS.Local.VA.Terminology.CTTMap).%OpenId(pMap.ID,4,.tSC)
	If '$isObject(tCTTObj) {
		Set tCTTObj=##class(HS.Local.VA.Terminology.CTTMap).%New()
	}
	Set tCTTObj.FromCodeSystem=pMap.FromCodeSystem
	Set tCTTObj.ToCodeSystem=pMap.ToCodeSystem
	Set tCTTObj.FromCode=pMap.FromCode
	Set tCTTObj.DateAdded=+$h
	Set tObj.Status=tCTTObj.%Save()
}
Quit tObj

