 	;
 	;Enable End of File $ZEOF
 	do $system.Process.SetZEOF(1)
 	;
 	;Define the SNOMED file
 	S filename="c:\temp\sct2_Description_Full-en_US1000124_20180301.txt"
 	;
 	;Open the file Readonly
 	O filename:("R"):5
 	U filename R X:1
 	;
 	; Loop over the records
 	F I=1:1 { 
 		;
 		; Read the record
		Q:($ZEOF=-1)
 		;
 		;U terminal W !,"I = ",I
 		;
 		U filename R X:1
		;
		Q:($ZEOF=-1)
		;
		; Instantiate your new object
		S codeset=##class(ISC.Terminology.CodeSet).%New()
		;
		; Set the properties
		S codeset.Code=$P(X,$C(9),1)
		S codeset.Description=$P(X,$C(9),8)
		S codeset.CodeType="SCT"
		S codeset.Status=$P(X,$C(9),3)
		S Y=$P(X,$C(9),2)
		S codeset.EffectiveDate=$E(Y,1,4)_"-"_$E(Y,5,6)_"-"_$E(Y,7,8)
		;
		; Save the sucker
		S sc=codeset.%Save()
		BREAK:'sc
		;
